import {
  Firestore,
  VehiclesCollection /*VehiclesDoc*/,
} from "@/firebase-exports";

/**
 * Obtiene un número aleatorio para las motos.
 * @returns {number} Número aleatorio para las motos.
 */
export function getMotos() {
  let numeroAleatorio = Math.floor(Math.random() * 100) + 1;
  return numeroAleatorio;
}

/**
 * Obtiene un número aleatorio para los coches.
 * @returns {number} Número aleatorio para los coches.
 */
export function getCoches() {
  let numeroAleatorio = Math.floor(Math.random() * 10) + 1;
  return numeroAleatorio;
}

/**
 * Agrega un vehículo a la colección de vehículos.
 * @param {Object} data - Datos del vehículo a agregar.
 * @returns {Promise} Promesa que se resuelve cuando se agrega el vehículo.
 */
export async function addVehicle(data) {
  return await Firestore.addDoc(VehiclesCollection(data.userId), {
    ...data,
  });
}

/**
 * Agrega un coche a la colección de vehículos.
 * @param {Object} data - Datos del coche a agregar.
 * @returns {Promise} Promesa que se resuelve cuando se agrega el coche.
 */
export async function addCoche(data) {
  return await Firestore.addDoc(VehiclesCollection(data.userId), {
    ...data,
  });
}

/**
 * Agrega una moto a la colección de vehículos.
 * @param {Object} data - Datos de la moto a agregar.
 * @returns {Promise} Promesa que se resuelve cuando se agrega la moto.
 */
export async function addMoto(data) {
  return await Firestore.addDoc(VehiclesCollection(data.userId), {
    ...data,
  });
}

export async function signaturesSubscription(userId, user, days = 90) {
  const todaysDate = new Date();

  const from = new Date().setDate(todaysDate.getDate() - days);
  const fromDate = new Date(from);

  const to = new Date().setDate(todaysDate.getDate() + 1); // Add + 1 day to get new docs after initializing subscription
  const toDate = new Date(to);

  const unsub = Firestore.onSnapshot(
    Firestore.query(
      SignaturesCollection(userId),
      Firestore.orderBy("createdAt", "desc")
    ),
    async (querySnapshot) => {
      let signatures = await Promise.all(
        querySnapshot.docs.map(async (doc) => {
          const document = doc.data();
          if (document.requesterRef)
            document.requester = await GetDocFromReference(
              document.requesterRef
            );

          if (document.cifRef)
            document.cif = await GetDocFromReference(document.cifRef);

          if (document.dateDeferred)
            document.dateDeferred = document.dateDeferred.toDate();

          if (document.createdAt)
            document.createdAt = document.createdAt.toDate();

          if (document.dateLimit)
            document.dateLimit = document.dateLimit.toDate();

          if (document.alert)
            document.alert.date = document.alert.date.toDate();

          delete document.infoOTP;

          return { id: doc.id, ...document };
        })
      );

      // Filtramos por cif, si es operador los Ids no coinciden
      if (userId !== user.id) {
        const cifs = user.cifs
          .filter((cif) => cif.firmasActivas)
          .map((cif) => cif.numeroDocIdentidad);
        signatures = signatures.filter((signature) => {
          return (
            cifs.includes(signature.cif?.numeroDocIdentidad) &&
            user.cifsPermissions[signature.cif?.numeroDocIdentidad]
              .firmasActivas &&
            (store.getters.isAdminUser ||
              signature.requesterRef.id === user.id ||
              signature.clientsToSign.some((client) => client.id === user.id))
          );
        });
      }

      // Guardamos en el store
      store.commit("setSignatures", signatures);
      store.commit("setSignaturesUnsubscribe", unsub);
    }
  );

  return unsub;
}
